INSERT INTO `article` (`titre`, `contenu`) VALUES
('La problématique de la traduction automatique ', 'Les constantes mutations internes subies par l\'activité de traduction témoigne de son\r\nimportance dans les relations humaines. Elle continue désormais son développement\r\nen tirant profit des évolutions technologiques. Nous parlons de plus en plus de\r\ntraduction automatique. Cette pratique poursuit sa conquête dans les habitudes aussi\r\nbien des universitaires que des professionnels de tous les domaines. Dans cet article,\r\nnous faisons le point de la traduction automatique, à la lumière des résultats des\r\nthéories des opérations en sciences du langage. En effet, quelles que soient les\r\nméthodes ou procédures utilisées, la traduction demeure une activité linguistique. Il\r\ns’agit en effet d’énoncés au départ et à la fin du processus. Nous attirons l’attention\r\ndes populations intéressées par la traduction automatique sur le fait que, bien que les\r\nprogrès technologiques proposent des résultats assez satisfaisants par endroits, il\r\ndemeure de nombreuses insuffisances en raison des micro- et macrophénomènes\r\ndynamiques qui font la particularité de l’activité langagière. Nous sommes encore loin\r\nde ce jour où les outils informatiques produiront des traductions identiques au travail\r\nde l’Homme. Demain, peut-être. \r\n\r\nLe LTI conduit des recherches variées en linguistique informatique, en traduction\r\nautomatique, en reconnaissance et synthèse vocales, en apprentissage des langues\r\nassisté par ordinateur, en intelligence artificielle, etc.\r\nCe survol rapide qui présente un échantillon des centres de recherche permet\r\nd’appréhender l’importance accordée au traitement automatique des langues\r\nnaturelles. Les énormes ressources allouées, par les institutions aussi bien privées que\r\ngouvernementales constituent est indice de l’importance de l’enjeu. La modélisation\r\ndu langage et la traduction automatique font partie des postes privilégiés de dépenses\r\nde budget. Le paysage de la traduction automatique est composé de deux parties essentielles: la\r\ntraduction automatique logicielle et la traduction automatique en ligne.\r\n13\r\na. La traduction automatique logicielle\r\nLa traduction automatique logicielle, ou traduction hors ligne, est un processus basé\r\nsur un logiciel de traduction installé sur un ordinateur. Ces logiciels sont de plus en\r\nplus sophistiqués et offrent des possibilités de plus en plus appréciées par les\r\nutilisateurs. Ces derniers proviennent de différentes couches de la société:\r\nuniversitaires, professionnels du monde des affaires, étudiants, programmeurs,\r\nconcepteurs de sites internet, etc. '),
('article2', '>Les textes scientifiques et médicaux développent des idées complexes au moyen d’une terminologie à la fois spécifique et pointue. En raison de la diversité et de l’ampleur des différents domaines que comporte cette catégorie, notre agence de traduction scientifique et médicale sélectionne pour vous les traducteurs les mieux adaptés à chaque projet en tenant particulièrement compte de leurs expériences et de leur compréhension des termes scientifiques et médicaux. L’objectif est de s’assurer que la traduction reflète avec précision le sens du texte source.'),
('article3', '>Les textes scientifiques et médicaux développent des idées complexes au moyen d’une terminologie à la fois spécifique et pointue. En raison de la diversité et de l’ampleur des différents domaines que comporte cette catégorie, notre agence de traduction scientifique et médicale sélectionne pour vous les traducteurs les mieux adaptés à chaque projet en tenant particulièrement compte de leurs expériences et de leur compréhension des termes scientifiques et médicaux. L’objectif est de s’assurer que la traduction reflète avec précision le sens du texte source.');

